import React, { useState } from 'react'


// const date = new Date()
// const dis_time = date.toLocaleTimeString()




const Profile = () => {
  const [times, setTimes]= useState()

  function incr(){
    setTimes(times)

  }



  return(
    <>
      <h1>{times}</h1>
      <button onClick={incr}>Update</button>
    </>
  )
}

export default Profile
